import React from "react";
import { Segment } from "semantic-ui-react";

const HomeComponent = content => <Segment padded vertical attached style={ { left: '1%', right: '1%', position: 'fixed', zIndex: 1000 }}>{content.item}</Segment>

export default HomeComponent;
